import BirthdayList from './BirthdayList'

export default function Content(props) {
  const birthdays = [{
    date: 'Mar 14',
    name: 'Luke', 
    lastNaem: 'Skywalker'},{
    date: 'Dec 29',
    name: 'Darth', 
    lastNaem: 'Vader'},{
    date: 'Feb 8',
    name: 'lipum', 
    lastNaem: 'holler'},{
    date: 'Sept 22',
    name: 'han'
    , lastNaem: 'solo'},{
    date: 'Aug 18',
    firstName: 'fooooo',
    lastNaem: 'baaaaaaaz'}
    ]
  return (
    <div>
      <h3>
        <BirthdayList 
          birthdays= {birthdays}
        />
      </h3>
    </div>
  )
}
